        null\n        },\n        {\n            \"description\": \"Land cover is
        a key variable in the context of climate change. In particular, crop type
        information is essential to understand the spatial distribution of water usage
        and anticipate the risk of water scarcity and the consequent danger of food
        insecurity. This applies to arid regions such as the Aral Sea Basin (ASB),
        Central Asia, where agriculture relies heavily on irrigation. Here, remote
        sensing is valuable to map crop types, but its quality depends on consistent
        ground-truth data. Yet, in the ASB, such data is missing. Addressing this
        issue, we collected thousands of polygons on crop types, 97.7% of which in
        Uzbekistan and the remaining in Tajikistan. We collected 8,196 samples between
        2015 and 2018, 213 in 2011 and 26 in 2008. Our data compiles samples for 40
        crop types and is dominated by \\u201ccotton\\u201d (40%) and \\u201cwheat\\u201d,
        (25%). These data were meticulously validated using expert knowledge and remote
        sensing data and relied on transferable, open-source workflows that will assure
        the consistency of future sampling campaigns.\",\n            \"extent\":
